import React from 'react'
import { KTSVG, toAbsoluteUrl } from '_metronic/helpers'
import {ComputerModel, ProxyModel} from 'app/modules/history/models/Account'
import {resetComputer} from 'app/modules/history/redux/AccountCRUD'
import moment from 'moment'
import {round} from "@popperjs/core/lib/utils/math";
import {actions} from "../../../orderdone";
type Props = {
    item: ProxyModel,
    index: number
}

const ComputerItem: React.FC<Props> = ({ item, index }) => {

    const clickDeleteHandler= async()=>{
        if (window.confirm("bạn có chắc chắn muốn reset luồng trên VPS này") == true) {
            const res:any = await resetComputer(item.ipv4)
            //dispatch(actions.deleteOrderRequest(item.channel_id))
        }
    }

    return (
        <tr style={{margin:100}}>
            <td className='w-25px'>
                <div className='form-check form-check-sm form-check-custom form-check-solid'>
                    <input
                        onChange={(evt)=>{
                            dispatch(actions.checkedChange({
                                videoid:item.videoid,
                                checked:evt.target.checked
                            }))
                        }}
                        className='form-check-input'
                        type='checkbox'
                        value={1}
                        checked={item.checked}
                        data-kt-check='true'
                        data-kt-check-target='.widget-13-check'
                    />
                </div>
            </td>
            <td>
                <div className='d-flex flex-stack mb-2'>
                    <span className='text-muted me-2 fs-7 fw-bold'>{index + 1}</span>
                </div>
            </td>
            <td>
                <a href='#' style={{textDecorationLine:'none'}} className='text-sm text-dark fw-bolder text-hover-primary d-block mb-1 '>
                    {item.ipv4}
                </a>
            </td>
            <td>
                <span style={{fontSize:11,color:'black'}} className='badge badge-warning'>{item.totalport}</span>
            </td>
            <td>

                <span className='badge badge-success'>{round((Date.now()-item.timecheck)/1000/60)}m</span>
            </td>
            <td>

                <span className='badge badge-danger'>{item.state}</span>
            </td>
            <td>

                <span className='badge badge-danger'>{item.geo}</span>
            </td>

            <td>

                    <a href='#' onClick={clickDeleteHandler} className='btn btn-icon  btn-active-color-primary btn-sm'>
                    <KTSVG path='/media/icons/duotune/general/gen027.svg' className={item.state==0?'svg-icon-danger':'svg-icon-3'} />
                    </a>

            </td>
        </tr>
    )
}

export default ComputerItem
